  false,\n\t\"url\": null,\n\t\"notes\": \"Includes accidents that occured on MD Transportation
  Authority (MDTA) facilities, or were within a concurrent jurisdiction and were responded
  to by MDTA Police. MDTA facilities are the Francis Scott Key Bridge (I-695), John
  F. Kennedy Memorial Highway (I-95), Thomas J. Hatem Memorial Bridge (US 40), Fort
  McHenry Tunnel (I-95), Baltimore Harbor Tunnel (I-895), the Bay Bridge (US 50/301),
  Governor Harry W. Nice Memorial Bridge (US 301), and Intercounty Connector (ICC/MD200).
  MDTA Police are also responsible for accidents at BWI Airport and the Port of Baltimore.
